  const [todo, setToDo] = useState<string>("")
  return (
    <BrowserRouter>
      <Routes>
        <Route element={<Header />}>
          <Route index element={<MoviesList />} />
          <Route path=":id" element={<MoviesList />} />
        </Route>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
